import FormSell from './ModalSell';
import { Box } from '@mui/joy';
import CardSale from './CardSale';
import Typography from 'antd/es/typography/Typography';
import CloseIcon from '@mui/icons-material/Close';

export default function ModalSale() {
  const handleCloseModal = () => {
    setIsModalOpen(false);
  };
  return (
    <Box
      display={'flex'}
      flexDirection={'column'}
      textAlign={'center'}
      backgroundColor={'white'}
      borderRadius={'10px'}
      padding={'15px'}
      gap={'10px'}
      position={'absolute'}
      top={'150px'}
      right={'25%'}
    >
      <CloseIcon sx={{cursor: 'pointer', position: 'absolute', top: '-35px', right: '-30px', fontSize: '40px'}}/>
      <Typography style={{ margin: '0px' }} component='h2'>
        Ваш Заказ №{' '}
      </Typography>
      <Box display={'flex'} gap={'30px'} flexDirection={'row'}>
        <CardSale />
        <FormSell />
      </Box>
    </Box>
  );
}
